/*Table structure for table `brand_large_type` */

DROP TABLE IF EXISTS `brand_large_type`;

CREATE TABLE `brand_large_type` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `catalog` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '目录',
  `cnno` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '中文序号，第几类',
  `no` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '序号，第几类',
  `name` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '类别名',
  `instruction` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '简介',
  `remark` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '说明',
  `record_status` char(1) CHARACTER SET utf8 NOT NULL COMMENT '是否已经失效',
  `update_count` int(11) NOT NULL COMMENT '记录更新次数',
  `create_date` datetime NOT NULL COMMENT '记录创建日期',
  `creator_id` bigint(20) DEFAULT NULL COMMENT '记录创建者ID',
  `update_date` datetime DEFAULT NULL COMMENT '更新日期',
  `updater_id` bigint(20) DEFAULT NULL COMMENT '更新者ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商标大类表';

/*Data for the table `brand_large_type` */

insert  into `brand_large_type`(`id`,`catalog`,`cnno`,`no`,`name`,`instruction`,`remark`,`record_status`,`update_count`,`create_date`,`creator_id`,`update_date`,`updater_id`) values (1,'01','第一类','001','化学原料','用于工业、科学、摄影、农业、园艺和林业的化学品；未加工人造合成树脂，未加工塑料物质，肥料，灭火用合成物，淬火和金属焊接用制剂，保存食品用化学品，鞣料，工业用粘合剂','第一类主要包括用于工业、科学和农业的化学制品，包括用于制造属于其他类别的产品的化学制品。</p >|\r\n<p>本类尤其包括：</p >|\r\n<small>堆肥；</small>|\r\n<small>非食品防腐盐；</small>|\r\n<small>某些特定的食品工业用添加剂（查阅按字母顺序排列的商品分类表）。</small>|\r\n<p>本类尤其不包括：</p >|\r\n<small>未加工的天然树脂（第二类）；</small>|\r\n<small>医学科学用化学制品（第五类）；</small>|\r\n<small>杀真菌剂、除莠剂和消灭有害动物制剂（第五类）；</small>|\r\n<small>文具用或家用粘合剂（第十六类）；</small>|\r\n<small>食品用防腐盐（第三十类）；</small>|\r\n<small>褥草（腐殖土的覆盖物）（第三十一类）。</small>|','A',0,'2019-01-21 11:25:35',-4,'2020-06-28 16:56:24',1),(2,'02','第二类','002','颜料油漆','颜料，清漆，漆，防锈剂和木材防腐剂，着色剂，媒染剂，未加工的天然树脂，画家、装饰家、印刷 商 和艺术家用金属箔及金属粉','第二类主要包括颜料、染料和防腐制品。\r\n本类尤其包括：\r\n工业、手工业和艺术用颜料、清漆和漆；\r\n服装染料；\r\n食品和饮料用着色剂。\r\n本类尤其不包括：\r\n未加工的人造树脂（第一类）；\r\n洗衣和漂白用上蓝剂（第三类）；\r\n美容用染料（第三类）；\r\n颜料盒（学校用文具）（第十六类）；\r\n绝缘颜料和绝缘漆（第十七类）。','A',0,'2019-01-21 11:50:23',1,'2019-03-19 09:17:26',1),(3,'03','第三类','003','日化用品','洗衣用漂白剂及其他物料，清洁、擦亮、去渍及研磨用制剂，肥皂，香料，香精油，化妆品，发水， 牙膏','第三类主要包括清洁制剂和梳妆用制剂。\r\n本类尤其包括：\r\n人用或动物用除臭剂；\r\n室内芳香剂；\r\n梳妆用卫生制剂。\r\n本类尤其不包括：\r\n清洁烟囱用化学制品（第一类）；\r\n生产过程中用的去渍制剂（第一类）；\r\n非人用、非动物用除臭剂（第五类）；\r\n磨石和砂轮（手工具）（第八类）。','A',0,'2019-01-21 16:48:30',1,'2019-01-22 13:56:40',1),(4,'04','第四类','004','燃料油脂','工业用油及油脂,润滑剂,吸收、喷洒和粘结灰尘用品,燃料（包括马达用的汽油）和照明材料 ,照明用蜡烛和灯芯','第四类主要包括工业用油和油脂，燃料和照明材料。\r\n本类尤其不包括：\r\n某些特殊的工业用油和油脂（查阅按字母顺序排列的商品分类表）。','A',0,'2019-01-23 11:50:34',1,'2019-01-23 11:50:34',1),(5,'05','第五类','005','医药卫生','医用和兽医用制剂，医用卫生制剂,医用营养品,婴儿食品,膏药,绷敷材料,填塞牙孔和牙模用料,消毒剂,消灭有害动物制剂,杀真菌剂,除锈剂','第五类主要包括药品和其他医用或兽医用制剂。\r\n本类尤其包括：\r\n婴儿和失禁者用尿布；\r\n除梳妆用制剂以外的个人保健用卫生制剂；\r\n非人用、非动物用除臭剂；\r\n膳食补充剂，为正常饮食提供补充或为健康目的；\r\n医用或兽医用代餐物、营养食物和饮料；\r\n不含烟草的医用卷烟。\r\n本类尤其不包括：\r\n梳妆用卫生制剂（第三类）；\r\n人用或动物用除臭剂（第三类）；\r\n矫形用绷带（第十类）；\r\n非医用、非兽医用的代餐物、营养食物和饮料（第二十九类、第三十类、第三十一类、第三十二类或第三十三类）。','A',0,'2019-01-23 11:51:29',1,'2019-03-21 15:24:51',1),(6,'06','第六类','006','金属材料','普通金属及其合金，金属建筑材料 ，可移动金属建筑物，铁轨用金属材料 ，非电气用缆索和金属线，小五金具，金属管，保险箱，不属别类的普通金属制品，矿砂','第六类主要包括未加工的和半加工的普通金属，以及这些金属的简单制品。\r\n本类尤其不包括：\r\n-铝土（第一类）；\r\n-汞，锑，碱金属和碱土金属（第一类）；\r\n-画家、装饰家、印刷商和艺术家用金属箔及金属粉（第二类）。','A',0,'2019-03-11 14:46:42',1,'2019-03-11 14:46:42',1),(7,'07','第七类','007','机械设备','机器和机床，马达和发动机（陆地车辆用的除外），机器传动用联轴节和传动机件（陆地车辆用的除外），非手动农业工具，卵化器','第七类主要包括机器、机床、马达和引擎。\r\n本类尤其包括：\r\n-各类马达和引擎的部件；\r\n-电动清洁机器和装置。\r\n本类尤其不包括：\r\n-某些特殊的机器和机床（查阅按字母顺序排列的商品分类表）；\r\n-手动的手工具和器具（第八类）；\r\n-陆地车辆用马达和引擎（第十二类）。','A',0,'2019-03-11 14:47:57',1,'2019-03-11 14:47:57',1),(8,'08','第八类','008','手工器械','手工用具和器械（手工操作的），刀、叉和勺餐具，佩刀，剃刀','第八类主要包括各种行业的作为工具使用的手动器具。\r\n本类尤其包括：\r\n-贵重金属制刀、叉和勺餐具；\r\n-电动剃刀和修剪刀（手工器具）\r\n本类尤其不包括：\r\n-某些特殊器具（查阅按字母顺序排列的商品分类表）；\r\n-马达带动的机床和器具（第七类）；\r\n-外科手术刀（第十类）；\r\n-作为火器的随身武器（第十三类）；\r\n-切纸刀（第十六类）；\r\n-击剑用兵器（第二十八类）。','A',0,'2019-03-11 14:51:30',1,'2019-03-26 15:24:48',1),(9,'09','第九类','009','科学仪器','科学、航海、测地、摄影、电影、光学、衡具、量具、信号、检验（监督）、救护（营救）和教学用具及仪器，处理、开关、传送、积累、调节或控制电的仪器和器 具，录制、通讯、重放声音和形象的器具，磁性数据载体，录音盘，自动售货器和投币启动装置和投币启动装置的机械结构，现金收入记录机，计算机和数据处理装 置，灭火器械','第九类尤其包括：\r\n-实验室科研用仪器及器械；\r\n-领航用电气仪器及器械，如测量和传令仪器及器械；\r\n-量角器；\r\n-穿孔卡式办公机械；\r\n-不论录制媒体或传播途径的所有的计算机程序和软件，即包括录制在磁性媒体 上的软件或从远程计算机网络上下载的软件。\r\n尤其不包括：\r\n-下列电动仪器及器械： （1）炊事用电气用具（食品碾磨和搅拌器、榨果汁器、电动磨咖啡器等）和第 七类中使用电动机的其他设备及器具； （2）抽取或分发燃料的器具（第七类）； （3）电动剃刀和理发推子（手工具）（第八类）； （4）电动牙刷和梳子（第二十一类）； （5）房间加热或液体加热、烹调、通风等电器设备（第十一类）；\r\n-钟表和其他计时器（第十四类）；\r\n-时间控制钟（第十四类）；\r\n-与外接显示屏或监视器连用的娱乐和游戏装置（第二十八类）。','A',0,'2019-03-11 14:56:18',1,'2019-03-11 14:56:18',1),(10,'10','第十类','010','医疗器械','外科、医疗、牙科和兽医用仪器及器械，假肢、假眼和假牙，矫形用品，缝合用材料','第十类主要包括医疗仪器、器械及用品。\r\n本类尤其包括：\r\n-医用特种家具；\r\n-橡胶卫生用品（查阅按字母顺序排列的商品分类表）；\r\n-矫形用绷带。','A',0,'2019-03-11 14:57:00',1,'2019-03-11 14:57:00',1),(11,'11','第十一类','011','灯具空调','照明、加温、蒸汽、烹调、冷藏、干燥、通风、供水以及卫生设备装置','本类尤其包括：\r\n-空气调节装置；\r\n-电或非电的暖床器，暖水袋，长柄暖床炉；\r\n-非医用电热垫和电热毯：\r\n-电水壶；\r\n-电烹调用具。\r\n本类尤其不包括：\r\n-制造蒸汽的装置（机器部件）（第七类）；\r\n-电暖衣服（第九类）。','A',0,'2019-03-11 14:58:28',1,'2019-03-11 14:58:28',1),(12,'12','第十二类','012','运输工具','车辆，陆、空、海用运载器','本类尤其包括：\r\n-陆地车辆用马达和引擎；\r\n-陆地车辆用联结器和传动机件；\r\n-气垫船。\r\n本类尤其不包括：\r\n-车辆的某些部件（查阅按字母顺序排列的商品分类表）；\r\n-铁路用金属材料（第六类）；\r\n-非陆地车辆用马达、引擎、联结器和传动机件（第七类）；\r\n-所有马达和引擎的部件（第七类）。','A',0,'2019-03-11 14:59:36',1,'2019-03-11 14:59:36',1),(13,'13','第十三类','013','军火烟火','火器，军火及子弹，爆炸物，烟火','第十三类主要包括火器和花炮产品。\r\n本类尤其不包括\r\n-火柴（第三十四类）。','A',0,'2019-03-11 15:00:10',1,'2019-03-11 15:00:10',1),(14,'14','第十四类','014','珠宝钟表','贵重金属及其合金以及不属别类的贵重金属制品或镀有贵重金属的物品，珠宝，首饰，宝石，钟表和计时仪器','第十四类主要包括贵重金属，不属别类的贵重金属制品，并通常包括珠宝首饰和钟表。\r\n本类尤其包括：\r\n-首饰（即仿真首饰、贵重金属制首饰和宝石）；\r\n-衬衫袖口的链扣，领带饰针。\r\n本类尤其不包括：\r\n-按功能或用途进行分类的贵重金属制品，如：画家、装饰家、印刷商和艺术家用金属箔及金属粉（第二类），牙科用金汞合金（第五类），刀、叉和勺餐具（第八类），电触点（第九类），金笔尖（第十六类），茶壶（第二十一类），金银线制刺绣品（第二十六类），雪茄烟盒（第三十四类）；\r\n-非贵重金属制艺术品（按其原料分类）。','A',0,'2019-03-11 15:00:55',1,'2019-03-11 15:00:55',1),(15,'15','第十五类','015','乐器用品','乐器、','本类尤其包括：\r\n-机械钢琴及其附件；\r\n-八音盒；\r\n-电动和电子乐器。\r\n本类尤其不包括：\r\n-录音、播音、扩音和放音装置（第九类）。','A',0,'2019-03-11 15:04:19',1,'2019-03-11 15:04:19',1),(16,'16','第十六类','016','办公用品','不属别类的纸、纸板及其制品,印刷品,装订用品,照片,文具用品,文具或家庭用粘合剂,美术用品,画笔,打字机和办公用品（家俱除外）,教育或教学用品（仪器除外），包装用塑料物品（不属别类的），印刷铅字，印版','第十六类主要包括纸、纸制品和办公用品。\r\n本类尤其包括：\r\n-切纸刀；\r\n-油印机；\r\n-包装用塑料纸、塑料提兜和塑料袋。\r\n本类尤其不包括：\r\n-某些纸制品和纸板制品（查阅按字母顺序排列的商品分类表）；\r\n-颜料（第二类）；\r\n-艺术家用手工具（如修平刀、雕塑凿刀）（第八类）。','A',0,'2019-03-11 15:05:22',1,'2019-03-11 15:05:22',1),(17,'17','第十七类','017','橡胶制品','不属别类的橡胶、古塔胶、树胶、石棉、云母以及这些原材料的制品,生产用半成品塑料制品,包装、填充和绝缘用材料,非金属软管','第十七类主要包括电绝缘，隔热或隔音材料，以及生产用塑料片、板或杆。\r\n本类尤其包括：\r\n-修复轮胎用橡胶材料；\r\n-橡胶或塑料制衬垫及填充料；\r\n-抗污染的浮动屏障。','A',0,'2019-03-11 15:06:29',1,'2019-03-11 15:06:29',1),(18,'18','第十八类','018','皮革皮具','皮革及人造皮革,不属别类的皮革及人造皮革制品,毛皮,箱子及旅行袋,雨伞、阳伞及手杖,鞭和马具','第十八类主要包括皮革、人造皮革、不属别类的旅行用品和马具。\r\n本类尤其不包括：\r\n-服装、鞋、帽（查阅按字母顺序排列的商品分类表）。','A',0,'2019-03-11 15:17:56',1,'2019-03-11 15:17:56',1),(19,'19','第十九类','019','建筑材料','非金属的建筑材料,建筑用非金属刚性管,沥青,柏油,可移动非金属建筑物,非金属碑','第十九类主要包括非金属建筑材料。\r\n本类尤其包括：\r\n-半成品木材（如横梁、板、护板）；\r\n-胶合板；\r\n-建筑用玻璃（如平板、玻璃瓦片）；\r\n-路标用玻璃颗粒；\r\n-混凝土制信箱。\r\n本类尤其不包括：\r\n-水泥贮藏或防水用制剂（第一类）；\r\n-防火制剂（第一类）。','A',0,'2019-03-11 15:1