要包括铺在已建成的地板和墙壁上的制品。\r\n本类尤其不包括：\r\n-木地板（第十九类）。','A',0,'2019-03-11 15:26:54',1,'2019-03-11 15:26:54',1),(28,'28','第二十八类','028','玩具健身','娱乐品、玩具，不属别类的体育及运动用品、圣诞树用装饰品','第二十八类尤其包括：\r\n-与外接显示屏或监视器连用的娱乐和游戏装置；\r\n-钓鱼用具；\r\n—各种运动和游戏设备。\r\n本类尤其不包括：\r\n-圣诞树用的蜡烛（第四类）；\r\n-潜水装备（第九类）；\r\n-圣诞树用的电灯（花彩式的）（第十一类）；\r\n-渔网（第二十二类）；\r\n-体育和运动用服装（第二十五类）；\r\n-圣诞树装饰用糖果和巧克力（第三十类）。','A',0,'2019-03-11 15:28:05',1,'2019-04-03 14:24:01',1),(29,'29','第二十九类','029','肉类食品','肉、鱼、家禽及野味、肉汁、腌渍、干制及煮熟的水果和蔬菜、果冻、果酱、蜜饯、蛋、奶及乳制品、食用油和油脂','第二十九类主要包括动物类食品，以及日用或贮藏用的蔬菜及其他可食用的园艺产品。\r\n本类尤其包括：\r\n-奶饮料（以奶为主）。\r\n本类尤其不包括：\r\n-某些植物类食品（查阅按字母顺序排列的商品分类表）；\r\n-婴儿食品（第五类）；\r\n-医用营养食物和物质（第五类）；\r\n-膳食补充剂（第五类）；\r\n-色拉调味品（第三十类）。\r\n-待孵蛋（第三十一类）；\r\n-动物饲料（第三十一类）；\r\n-活的动物（第三十一类）。','A',0,'2019-03-11 15:29:17',1,'2019-03-11 15:29:17',1),(30,'30','第三十类','030','方便食品','咖啡、茶、可可、糖、米、食用淀粉、西米、咖啡代用品、面粉及谷类制品、面包、糕点及糖果、冰制食品、蜂蜜、糖浆、鲜酵母、发酵粉、食盐、芥末、醋、沙司（调味品）、调味用香料、饮用冰','第三十类主要包括日用或贮藏用的植物类食品，以及调味佐料。\r\n本类尤其包括：\r\n-以咖啡、可可、巧克力或茶为主的饮料；\r\n-人类食用谷物（如燕麦片或其他谷物）。\r\n本类尤其不包括：\r\n-某些植物类食品（查阅按字母顺序排列的商品分类表）；\r\n-非食用防腐盐（第一类）；\r\n-药茶和医用营养食物和物质（第五类）；\r\n-婴儿食品（第五类）；\r\n-膳食补充剂（第五类）；\r\n-未加工的谷物（第三十一类）；\r\n-动物饲料（第三十一类）。','A',0,'2019-03-11 15:30:32',1,'2019-03-11 15:30:32',1),(31,'31','第三十一类','031','饲料种籽','农业、园艺、林业产品及不属别类的谷物、牲畜、新鲜水果和蔬菜、种籽、草木及花卉、动物饲料、麦芽','第三十一类主要包括日用的未经制作的田地产物，活动物及植物，以及动物饲料。\r\n本类尤其包括：\r\n-未加工的木材；\r\n-未加工的谷物；\r\n-待孵蛋；\r\n-软体动物和贝壳类动物（活的）。\r\n本类尤其不包括：\r\n-微生物培养物和医用水蛭（第五类）；\r\n-动物用膳食补充剂（第五类）；\r\n-半成品木材（第十九类）；\r\n-人造鱼饵（第二十八类）；\r\n-米（第三十类）；\r\n-烟草（第三十四类）。','A',0,'2019-03-11 15:31:23',1,'2019-03-11 15:31:23',1),(32,'32','第三十二类','032','啤酒饮料','啤酒、矿泉水和汽水以及其他不含酒精的饮料、水果饮料及果汁、糖浆及其他供饮料用的制剂','第三十二类主要包括不含酒精的饮料及啤酒。\r\n本类尤其包括：\r\n-无酒精饮料。\r\n本类尤其不包括：\r\n-医用饮料（第五类）；\r\n-奶饮料（以奶为主）（第二十九类）；\r\n-以咖啡、可可、巧克力或茶为主的饮料（第三十类）。','A',0,'2019-03-11 15:33:25',1,'2019-03-11 15:33:25',1),(33,'33','第三十三类','033','含酒精酒','含酒精的饮料（啤酒除外）','本类尤其不包括：\r\n-医用饮料（第五类）；\r\n-无酒精饮料（第三十二类）。','A',0,'2019-03-11 15:35:17',1,'2019-03-11 15:35:17',1),(34,'34','第三十四类','034','烟草烟具','烟草、烟具、火柴','本类尤其包括：\r\n-烟草代用品（非医用的）。\r\n本类尤其不包括：\r\n-不含烟草的医用卷烟（第五类）。','A',0,'2019-03-11 15:36:25',1,'2019-03-11 15:36:25',1),(35,'35','第三十五类','035','广告销售','广告、实业经营、实业管理、办公事务','第三十五类主要包括由个人或组织提供的服务，其主要目的在于： ⑴对商业企业的经营或管理进行帮助； ⑵对工商企业的业务活动或者商业职能的管理进行帮助； 以及由广告部门为各种商品或服务提供的服务，旨在通过各种传播方式向公众进行广告宣传。\r\n本类尤其包括：\r\n-为他人将各种商品（运输除外）归类，以便顾客看到和购买；这种服务可由零售、批发商店通过邮购目录或电子媒介提供，例如通过网站或电视购物节目；\r\n-有关注册、抄录、写作、编篡、或者书面通讯及记录系统化，以及编篡数学或者统计资料的服务；\r\n-广告单位的服务，以及直接或邮寄散发说明书或者样品的服务；本类可涉及有关其他服务的广告，如银行借贷或无线电广告服务。\r\n本类尤其不包括：\r\n-与工商企业的经营或者管理无直接关系的估价和编写工程师报告的服务（查阅按字母顺序排列的服务分类表）。','A',0,'2019-03-11 15:37:11',1,'2019-03-11 15:37:11',1),(36,'36','第三十六类','036','金融物管','保险、金融、货币事务、不动产事务','第三十六类主要包括金融业务和货币业务提供的服务以及与各种保险契约有关的服务。\r\n本类尤其包括：\r\n-与金融业务和货币业务有关的服务，即： ⑴银行及其有关的机构的服务，如外汇经纪人或清算机构； ⑵不属于银行的信贷部门的服务，如信贷合作社团、私人金融公司、放款人等的服务； ⑶控股公司的“投资信托”服务； ⑷股票及财产经纪人的服务； ⑸与承受信用代理人担保的货币业务有关的服务； ⑹与发行旅行支票和信用证有关的服务；\r\n-融资租赁服务；\r\n-不动产管理人对建筑物的服务，如租赁、估价或筹措资金的服务；\r\n-与保险有关的服务，如保险代理人或经纪人提供的服务，为被保险人和承保人提供的服务。','A',0,'2019-03-11 15:38:27',1,'2019-03-11 15:38:27',1),(37,'37','第三十七类','037','建筑修理','房屋建筑、修理、安装服务','第三十七类主要包括建造永久性建筑的承包商或分包商所提供的服务，以及由个人或组织为修复建筑物或保持原样而不改变其物理或化学特征的服务。\r\n本类尤其包括：\r\n-建筑房屋、道路、桥梁、堤坝或通讯线路的服务，以及建筑行业其他专项服务，如油漆粉刷、管道铺设、安装暖气或盖屋顶；\r\n-为建筑服务的辅助性服务，如建筑计划的检查；\r\n-造船服务；\r\n-租赁建筑工具或材料的服务；\r\n-修理服务，即修复已磨损、损坏或部分破坏的任何东西（修复房屋或将其他残缺之物修复原样）；\r\n-各种修理服务，如修理电器、家具、器械和工具等；\r\n-维修服务，旨在使物品保持原样而不改变其任何属性（有关本类与第四十类的区别，请看第四十类的注释）。\r\n本类尤其不包括：\r\n-诸如服装或车辆之类商品的储存服务（第三十九类）；\r\n-与布料或服装印染有关的服务（第四十类）。','A',0,'2019-03-11 15:41:17',1,'2019-03-11 15:41:17',1),(38,'38','第三十八类','038','通讯服务','电信','第三十八类主要包括至少能使二人之间通过感觉方式进行通讯的服务。这类服务包括： ⑴能使一人与另一人进行交谈； ⑵将一人的消息传递给另一人； ⑶使一人与另一人进行口头或视觉的联系（无线电和电视）。\r\n本类尤其包括：\r\n-主要进行播放无线电或电视节目的服务。\r\n本类尤其不包括：\r\n-无线电广告服务（第三十五类）；\r\n-电话市场营销服务（第三十五类）。','A',0,'2019-03-11 15:42:04',1,'2019-03-11 15:42:04',1),(39,'39','第三十九类','039','运输贮藏','运输、商品包装和贮藏、旅行安排','第三十九类主要包括将人、动物或商品从一处运送到另一处（通过铁路、公路、水上、空中或管道）所提供的服务和与此有关的必要服务，以及货栈或者其他建筑物为便于看管、保存商品所提供贮藏的服务。\r\n本类尤其包括：\r\n-供运输者使用的由车站、桥梁、火车渡轮等公司提供的服务；\r\n-租赁运输车辆的服务；\r\n-与海上拖曳、卸货、港口和码头运转、营救遇险船只及其货物有关的服务；\r\n-发货前的包装和打包业务的服务；\r\n-经纪人及旅行社提供旅行或货运情况的服务以及提供价目、时刻或运送方式情况的服务；\r\n-运输前检查车辆或货物的服务。\r\n本类尤其不包括：\r\n-与运输企业广告有关的服务，如散发广告传单或无线电广告（第三十五类）；\r\n-由经纪人或旅行社提供的发行旅行支票或者信用证的服务（第三十六类）；\r\n-人或货物在运输过程中的（商业、火灾或生命）保险服务（第三十六类）；\r\n-维修车辆的服务，以及维修用于运输人或货物的运输工具的服务（第三十七类）；\r\n-由旅行社或经纪人提供的预定旅馆房间的服务（第四十三类）。','A',0,'2019-03-11 15:42:54',1,'2019-03-11 15:42:54',1),(40,'40','第四十类','040','材料加工','材料处理','第四十类主要包括没有列入其他类别的，对有机物质、无机物质或物品进行机械或者化学处理或者加工的服务。 按分类的要求，只有在为他人进行处理或加工的情况下，商标才视为服务标志。根据分类的同一要求，在某人将经过处理或加工的物质或物品进行交易的各种情况下，商标都被视为商品标志。\r\n本类尤其包括：\r\n-对物品或物质进行加工的服务，包括改变其主要特性的处理服务（如染服装）；按正常分类，维修服务应该列入第三十七类，但若是进行了这样的改变，即可列入第四十类（如汽车防冲击装置的镀铬处理）；\r\n-在物质生产或建筑物建造过程中的材料处理服务，如切割、加工成形，磨光或金属镀层方面的服务。\r\n本类尤其不包括：\r\n-修理服务（第三十七类）。','A',0,'2019-03-11 15:43:41',1,'2019-03-11 15:43:41',1),(41,'41','第四十一类','041','教育娱乐','教育、提供培训、娱乐、文体活动','第四十一类主要包括由个人或团体提供的人或动物智力开发方面的服务，以及用于娱乐或消遣时的服务。\r\n本类尤其包括：\r\n-有关人员教育或动物训练的各种形式的服务；\r\n-旨在人们娱乐、消遣或文娱活动的服务；\r\n-为文化和教育目的向公众展示可视艺术作品或文学作品。','A',0,'2019-03-11 15:45:06',1,'2019-03-11 15:45:06',1),(42,'42','第四十二类','042','科技编程','科学技术服务和与之相关的研究与设计服务；工业分析与研究；计算机硬件与软件的设计与开发；法律服务','第四十二类主要包括由人，个人或集体，提供的涉及复杂领域活动的理论和实践服务；这些服务由诸如化学家、物理学家、工程师、计算机程序员等专业人员提供。\r\n本类尤其包括：\r\n-由从事评估、估算以及从事科技领域研究与报告的工程师提供的服务；\r\n-为医务目的所做的科学研究服务。\r\n本类尤其不包括：\r\n-商业研究与开发（第三十五类）；\r\n-文字处理和计算机档案管理（第三十五类）；\r\n-金融与财政评估（第三十六类）；\r\n-采矿和石油开采（第三十七类）；\r\n-计算机（硬件）的安装与维修服务（第三十七类）；\r\n-由专业人员诸如医生、兽医和精神分析医生所提供的服务（第四十四类）；\r\n-医疗服务（第四十四类）；\r\n-花园设计（第四十四类）；\r\n-法律服务（第四十五类）。','A',0,'2019-03-11 15:46:23',1,'2019-03-11 15:46:23',1),(43,'43','第四十三类','043','餐饮住宿','提供食物和饮料服务、临时住宿','第四十三类主要包括由个人或机构为消费者提供食物和饮料的服务以及为使在宾馆、寄宿处或其他提供临时住宿的机构得到床位和寄宿所提供的服务。\r\n本类尤其包括：\r\n-为旅游者提供住宿预订服务，尤其是通过旅行社或经纪人提供的服务；\r\n-为动物提供膳食。\r\n本类尤其不包括：\r\n-提供永久使用的不动产，例如住房、公寓等的租赁服务（第三十六类）；\r\n-由旅行社提供的旅行服务（第三十九类）；\r\n-食物和饮料的防腐处理服务（第四十类）；\r\n-迪斯科舞厅服务（第四十一类）；\r\n-寄宿学校（第四十一类）；\r\n-疗养院（第四十四类）。','A',0,'2019-03-11 15:47:16',1,'2019-03-11 15:47:16',1),(44,'44','第四十四类','044','医疗园艺','医疗服务；兽医服务；人或动物的卫生和美容服务；农业、园艺或林业服务','第四十四类主要包括由个人或机构向人或动物提供的医疗、卫生和美容服务；它还包括与农业、园艺和林业领域相关的服务。\r\n本类尤其包括：\r\n-与治疗病人（例如Ｘ光检查和取血样）有关的医学分析；\r\n-人工授精服务；\r\n-医药咨询；\r\n-动物饲养；\r\n-与植物生长例如园艺有关的服务；\r\n-与植物艺术例如园艺设计和花卉构图有关的服务。\r\n本类尤其不包括：\r\n-灭害虫（为农业、园艺和林业目的除外）（第三十七类）；\r\n-灌溉系统的安装与维修服务（第三十七类）；\r\n-救护运输（第三十九类）；\r\n-动物屠宰及其标本制作（第四十类）；\r\n-树木砍伐和加工（第四十类）；\r\n-动物驯养（第四十一类）；\r\n-为体育锻炼目的而设的健康俱乐部（第四十一类）；\r\n-医学科学研究服务（第四十二类）；\r\n-为动物提供膳食（第四十三类）；\r\n-养老院（第四十三类）。','A',0,'2019-03-11 15:48:09',1,'2019-03-11 15:48:09',1),(45,'45','第四十五类','045','社会服务','由他人提供的为满足个人需要的私人和社会服务；为保护财产和人身安全的服务','本类尤其包括：\r\n-由律师为个人、组织、团体、企业提供的服务；\r\n-与个人或团体的安全相关的调查和监视服务；\r\n-为个人提供的与社会活动相关的服务，例如社交护送服务、婚姻介绍所、葬礼服务。\r\n本类尤其不包括：\r\n-为商业运作提供直接指导的专业服务（第三十五类）；\r\n-为处理与保险有关的金融或货币事务和服务有关的服务（第三十六类）；\r\n-护送旅客（第三十九类）；\r\n-安全运输（第三十九类）；\r\n-各种个人教育服务（第四十一类）；\r\n-歌唱演员和舞蹈演员的表演（第四十一类）；\r\n-为保护计算机软件所提供的计算机服务（第四十二类）；\r\n-由他人为人类和动物提供的医疗、卫生或美容服务（第四十四类）；\r\n-某些出租服务（查阅按字母顺序排列的服务分类表和一般性说明中有关服务分类的第2条）。','A',0,'2019-03-11 15:48:52',1,'2020-06-24 14:25:21',1);

/*Table structure for table `brand_small_type` */

DROP TABLE IF EXISTS `brand_small_type`;

CREATE TABLE `brand_small_type` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `large_type_id` bigint(20) NOT NULL COMMENT '大类ID brand_large_type',
  `no` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '类别编号',
  `name` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '类别名',
  `record_status` char(1) CHARACTER SET utf8 NOT NULL COMMENT '是否已经失效',
  `update_count` int(11) NOT NULL COMMENT '记录更新次数',
  `create_date` datetime NOT NULL COMMENT '记录创建日期',
